import { Radio as BaseRadio, RadioSlot, } from "@microsoft/fast-components-react-base";
import radioSchema from "./radio.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { RadioStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Radio = manageJss(RadioStyles)(BaseRadio);
export { Radio, radioSchema, RadioSlot, };
